variables.script:
function mostraP1 (){

		var sTipus = sInstallacio.sCaracteristiques.sRequisits.RB_Requisits.rawValue;

			if (sTipus == "P1"){
				sInstallacio.sCaracteristiques.sRequisits.sP1.presence = "visible";
				}else{
				sInstallacio.sCaracteristiques.sRequisits.sP1.presence = "hidden";
				}}

function mostraP2 (){

		var sTipus = sInstallacio.sCaracteristiques.sRequisits.RB_Requisits.rawValue;

			if (sTipus == "P2"){
				sInstallacio.sCaracteristiques.sRequisits.sP2.presence = "visible";
				}else{
				sInstallacio.sCaracteristiques.sRequisits.sP2.presence = "hidden";
				}
				}

function mostraG (){

		var sUs = sInstallacio.sCaracteristiques.sRequisits.TXT_Us.rawValue;

			if (sUs == "g"){
				sInstallacio.sCaracteristiques.sG.presence = "visible";
				sInstallacio.sCaracteristiques.sH.presence = "hidden";
				}}

function mostraH (){

		var sUs = sInstallacio.sCaracteristiques.sRequisits.TXT_Us.rawValue;

			if (sUs == "h"){
				sInstallacio.sCaracteristiques.sH.presence = "visible";
				sInstallacio.sCaracteristiques.sG.presence = "hidden";
				}}

function mostraAmaga (){

		var sUs = sInstallacio.sCaracteristiques.sRequisits.TXT_Us.rawValue;

			if (sUs != "h" && sUs != "g"){
			sInstallacio.sCaracteristiques.sG.presence = "hidden";
				sInstallacio.sCaracteristiques.sH.presence = "hidden";
				}}
